import actions from "./actions"

const initialState = {
  clients:[],
  page: 1,
  size: 25,
  sort: "creationDate",
  order: "desc"
}

export default function clientsReducer(state = initialState, action){
  switch (action.actions) {
    case actions.SET_STATE:
      return {...state, ...action.payload}
    default:
      return state
  }
}
